import React, { useState } from 'react';
import './Pictures.css';
import { makeStyles } from '@material-ui/core/styles';
import { entries } from './EntriesData.js'
import Grid from '@material-ui/core/Grid';
import FormLabel from '@material-ui/core/FormLabel';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import RadioGroup from '@material-ui/core/RadioGroup';
import Radio from '@material-ui/core/Radio';
import Paper from '@material-ui/core/Paper';
import { Button } from '@material-ui/core';

import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

import YourComponent from "./Something.js";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { useHistory } from "react-router-dom";



  const routeChange = () =>{ 
    let path = `newPath`; 
    history.push(path);
  }

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
  },
  gridList: {
    width: 600,
    height: 600,
    paddingLeft: 150,
    paddingTop: 100
  },
  button:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    maxHeight: 75
  }
}));
export default function Pictures(props) {
  const history = useHistory();

  const [spacing, setSpacing] = React.useState(2);
  const classes = useStyles(); 
    return(
      <div className={classes.root}>

        <GridList cellHeight={600}className={classes.gridList} cols={1}>
        <div className={classes.button}>
            <Button variant="contained"
          size="small"
          // fullWidth = true
          aria-label="add" className = {classes.root} onClick={() => { "window.location.href = 'http://www.google.com'"}}>{props.name}</Button>
          </div>
          <Button color="primary" className="px-4"
                onClick={routeChange}
                  >
                  Login
                </Button>
          {props.link.map((tile) => (
            <GridListTile key={tile} cols={tile.cols || 1}>
                  <img src={tile} alt={tile}/>
            </GridListTile>
          ))}
        </GridList>
      </div>
    )
}
